import React,{Component} from 'react';
import EmployeeMaster from '../Schema/employee_master'
import Form from 'react-jsonschema-form'
import API from 'axios'

const uischema ={
    "className" :"container",
}

const schema = EmployeeMaster.definitions.EmployeeDetails;




export default class EmployeePersonalDetails extends Component{
    constructor(props) {
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this)
    }

    handleSubmit(formData){
        API.post("http://localhost:3000/EmployeeDetails",formData.formData)
            .catch(res =>{alert('BAD REQUEST')})
    }
    render() {
        return(
            <div>
                <Form onSubmit={this.handleSubmit} schema={schema} uiSchema={uischema} liveValidate></Form>
            </div>
        )
    }
}
